{'pk': 17959817632079235, 'user_id': 3178593942, 'text': 'En la 7¬∞ @feriadeeditores estar√° disponible uno de los libros que m√°s disfrutamos armar, leer, releer y tener en las manos: "Por el camino de tierra", de Eric Schierloh. 
Diice Mat√≠as Moscardi:

‰ø≥Êñá ¬´Este ideograma corresponde a la palabra japonesa "haibun", escritura que combina la condensaci√≥n visual y conceptual del haiku y la recolecci√≥n heterog√©nea de experiencias que confluyen en un diario de viaje: fotos de paisajes atomizados en un punto ‚Äìun poste de luz, una sombra, una pi√±a en la hierba, el cad√°ver de una liebre, una fila de loros en el camino‚Äì, dibujos de escenas, estampas o mapas, retratos de animales ‚Äìperro, pez, polilla‚Äì, recordatorios literarios o archivos bibliogr√°ficos, notas mentales, versos como acotaciones reflexivas sobre el viento o la marea, textos que procesan la experiencia del entorno natural y las transiciones entre los distintos estados de la materia po√©tica ‚Äìuna foto puede devenir, indistintamente, dibujo o verso, el fantasma invisible de la brisa puede transformarse en imagen, un pensamiento puede ser un surco calado en la superficie del mar. Por el camino de tierra, de Eric Schierloh, es un libro de supervivencia: hay algo artesanal en su escritura que convoca el uso vital de todos los materiales disponibles. En estos poemas, se cruzan la novela de aventuras, el aura del n√°ufrago, el esp√≠ritu del explorador, el retiro nevado del ermita√±o, con el estoicismo imperturbable del Samur√°i: la lectura nos hipnotiza en un trance de isla desierta, nos confina a una lejan√≠a imaginaria que nos hace escuchar, otra vez, los sonidos fundamentales del mundo por sobre el ruido de la civilizaci√≥n. El efecto es, por supuesto, el de la desposesi√≥n: no tener otra cosa que un l√°piz, una libreta. ¬ª', 'type': 1, 'created_at': 1533867532, 'created_at_utc': 1533867532, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 3178593942, 'username': 'labolaeditora', 'full_name': 'la Bola editora', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/34982898_409737822847199_6409279064737054720_n.jpg?_